const sharp = require('sharp');
const {
	Buffer
} = require('buffer');

exports.handler = async (event, context) => {
	const method = event.httpMethod;
	try { // 假设 event.body 是二进制的 PNG 图像数据
		const buffer = Buffer.from(event.body, 'binary'); // 直接接收二进制数据并转换为 Buffer

		// 使用 sharp 处理图像并提取原始 RGBA 数据
		const image = await sharp(buffer).raw().toBuffer(); // 提取原始 RGBA 数据

		// 获取图像的宽度和高度
		const {
			width,
			height
		} = await sharp(buffer).metadata();
		console.log('图像宽度:', width, '高度:', height);

		// 提取 Alpha 通道并解码成明文
		let result = '';
		for (let i = 3; i < image.length; i += 4) { // 每 4 个字节代表一个像素，Alpha 通道是第 4 个字节
			const alpha = image[i]; // 获取 Alpha 值
			if (alpha >= 32 && alpha <= 126) { // 只处理可打印的 ASCII 字符（可根据需要修改范围）
				result += String.fromCharCode(alpha); // 转换为字符并拼接
			}
		}
		console.log('解码后的明文数据:', result); // 打印解码后的明文数据} catch (e) {
	}
	let responseData;
	let headers = {
		'Content-Type': 'application/json'
	};

	if (method === 'POST') {
		responseData = {
			code: 0,
			data: '',
			message: null
		};
		headers['X-D-I'] = 'tRY84woR9jliRWefUICkUxZv5j3o12MOHnS0nAp7XQs';
		headers['X-W-I'] = 'ChHsh9+LpfWCCRto9E3133NZUM7PgI1TJvsl1dsA9LU=';
		headers['X-C-M'] = 'XTeuJEeiVe5160gIP5GHYA==';
	} else if (method === 'GET') {
		responseData = '两只老虎跑得快，一只没有耳朵一直没有尾巴，真奇怪';
	} else {
		return {
			statusCode: 405,
			headers: {
				'Content-Type': 'application/json'
			},
			body: JSON.stringify({
				code: 1,
				message: 'Method Not Allowed'
			})
		};
	}

	return {
		statusCode: 200,
		headers,
		body: JSON.stringify(responseData)
	};
};